import React, { UseState } from 'react';


const ex = () => {
    const [workouts, setWorkouts] = UseState([{ "id" : 1,
        type: "Push",
        date : "7/26/2024",
    }])
    return ( <div className="ex">
        <h3>Past Workouts</h3>
        {workouts.map((workout) =>(
            <div key={workout.id}>
                <h2>{workout.type}</h2>
                <p>{workout.date}</p>
            </div>
        ))}

        </div> );
}
 
export default ex;
